css:
@-moz-document domain("lumosity.com") {
:root{
	--mm-dark-color:#111;
  	--mm-light-color:#ccc;
}

html, body, .dropdown-menu, .dashboards.show #sidebar .sidebar-section, .activity-section, .dashboards.show #actions, .ftr, .uYzkI, .pane, textarea, input[type="text"], input[type="password"], input[type="datetime"], input[type="datetime-local"], input[type="date"], input[type="month"], input[type="time"], input[type="week"], input[type="number"], input[type="email"], input[type="url"], input[type="search"], input[type="tel"], input[type="color"], .uneditable-input, .invite_system.invites #copy-link-wrapper, .invite_system.invites #copy-link-wrapper #link-box, #insight-reports .insight-report, #insight-reports .insight-report .report-get-premium, #insight-reports .insight-report .premium-only, .trainer_app.games.index .main-content-column, .trainer_app.settings .main-content-column, .trainer_app.comparisons .main-content-column, .trainer_app.brain_profiles .main-content-column, .trainer_app.history .main-content-column, .trainer_app.brain_tests .main-content-column, .selection.new #selection .item, .modal, .panel, #main-box-content-right-well, #history-value, .header, .trainer_app.dashboards.show .dashboard-section{
  	background-image:none;
	background-color:var(--mm-dark-color);	
}

html, body, .bar-chart label, .trainer_app.brain_profiles .explanation, .trainer_app.brain_profiles .superheader, .trainer_app.history.summaries .benefit, .trainer_app.comparisons.show #compare.no-access #paywall-v2 #reasons h5, .trainer_app.comparisons.show #compare.no-access #paywall-v2 #reasons .reason p, .game-item .brain-attribute, .game-item .brain-area, .hctKJM, .hfPoTr, h1, h2, h3, h4, h5, h6, .ftr--extended .footer__container .footer__link, .himZKo, input.span6, .dropdown-menu [role=menuitem], .user-info [role="button"], #training-calendar-redesign .calendar-week-day.header, #gameComplete #score-list li .score-column, #game-complete #score-list li .score-column, .ftr .nav li a, .ftr .nav li .jumpstart #masthead__cta, .ftr .nav li .jumpstart #masthead__cta--inverse, .ftr .nav li .jumpstart .header__cta--inverse, .jumpstart .ftr .nav li #masthead__cta, .jumpstart .ftr .nav li #masthead__cta--inverse, .jumpstart .ftr .nav li .header__cta--inverse, .ftr .nav li .jumpstart .header__cta, .jumpstart .ftr .nav li .header__cta, .ftr .nav li .jumpstart .body__cta, .ftr .nav li .jumpstart .body__cta--truncated, .ftr .nav li .jumpstart .body__cta--left-aligned, .ftr .nav li .jumpstart .body__cta--inverse, .jumpstart .ftr .nav li .body__cta, .jumpstart .ftr .nav li .body__cta--truncated, .jumpstart .ftr .nav li .body__cta--left-aligned, .jumpstart .ftr .nav li .body__cta--inverse, #workout-summary #slot-list .slot .slot-title-wrapper .brain-attribute{
	color:var(--mm-light-color);
}

.back-inverted{
  	background-image:none;
	background-color:var(--mm-light-color);	
}

.color-inverted, #history-value h2, #history-value h3, .game-item-grid:hover h6, .game-item-grid .overlay:hover p, .current-score .position-column{
	color:var(--mm-dark-color);
}

#workout-donut path[fill="#e5e6e7"]{
	fill:var(--mm-dark-color);
    stroke:var(--mm-light-color);
                            
}

#today-arrow span.caret.up{
	border-bottom: 4px solid var(--mm-light-color) !important;
}

}
